(function($,Drupal,once){Drupal.behaviors.webformRoles={attach:function(context){$(once('webform-roles','.js-webform-roles-role[value="authenticated"]',context)).each(function(){var $authenticated=$(this);var $checkboxes=$authenticated.parents('.form-checkboxes').find('.js-webform-roles-role').filter(function(){return($(this).val()!=='anonymous'&&$(this).val()!=='authenticated')});$authenticated.on('click',function(){if($authenticated.is(':checked')){$checkboxes.prop('checked',!0).attr('disabled',!0)}else{$checkboxes.prop('checked',!1).removeAttr('disabled')}});if($authenticated.is(':checked')){$checkboxes.prop('checked',!0).attr('disabled',!0)}})}}})(jQuery,Drupal,once)